public class hourlyEmployee extends employee{
    public hourlyEmployee(){
      super(0,25);
      
    };
    public hourlyEmployee(double salary,double rate){
        super(salary,rate);
    }
    public void setRate(double rate){
        super.setRate(rate);
    }
    @Override
    public double getRate(){
        return super.getRate();
    }
}
